// src/components/NavbarPage.jsx
import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const NavbarPage = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleDropdown = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="bg-gray-900 md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 fixed w-full top-0 z-10 hover:bg-white hover:border-b-2 border-black">
      <div className="container mx-auto flex flex-col md:flex-row md:justify-between md:items-center">
        <div className="flex justify-between items-center w-full md:w-auto">
          <Link to="/" className="text-yellow-500 text-4xl font-bold md:mb-0 mb-4 md:mb-0 hover:text-black">
            Even<span className="text-red-600">D</span>ango
          </Link>
          <button onClick={toggleDropdown} className="md:hidden text-yellow-500 hover:text-black focus:outline-none">
            â˜°
          </button>
        </div>
        <ul className={`md:flex flex-col md:flex-row md:space-x-2 p-4 space-x-0 md:space-y-0 ${isOpen ? 'block' : 'hidden'}`}>
          <li><Link to="/home" className="text-yellow-600 hover:text-black m-2 font-bold">Home</Link></li>
          <li><Link to="/profile" className="text-yellow-600 hover:text-black m-2 font-bold">Profile</Link></li>
          <li><Link to="/about" className="text-yellow-600 hover:text-black m-2 font-bold">About</Link></li>
          <li><Link to="/contact" className="text-yellow-600 hover:text-black m-2 font-bold">Contact</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default NavbarPage;
